import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.min.js';
import Header from './components/Header';
import Form from './components/Form'


function App() {
  return (

    <div className="App">

      <header className="App-header">
        <>
          <Header/>
        </>
        <>
          <Form/>
        </>


      </header>

    </div>
  );
}

export default App;
